import React from 'react'

const RecipeItem = ({title, calories, image , ingredients}) => {
  return (
    <div>
      <h1>{title}</h1>
      <p>{calories}</p>
      <img src={image} alt="" />
      <p>{ingredients}</p>
    </div>
  )
}

export default RecipeItem;
